import styles from './layout.module.css';
import './App.css';
import { AuthContextProvider } from '../../Context/AuthContext';

function App() {
  return (
<div className={styles.container}>
      <AuthContextProvider>
        <div className={styles.mainContent}>
        </div>
      </AuthContextProvider>
    </div>
  );
}

export default App;
